import React from 'react';

const produ = {
    userName:'petros',
    description:'he is tall and has long hair',
    gender:'male'
}

const Products = () => {


    return (
        <div>
            <div>
                {produ.description}
            </div>
            <div>
                {produ.gender}
            </div>
            
        </div>
    );
}

export default Products;
